import React from 'react'
import axios from 'axios'
import { Link } from 'react-router-dom';
import Footer from './Partials/Footer';
import Header from './Partials/Header';
import Sidebar from './Partials/Sidebar';

function Home() {
    const [products, setProducts] = React.useState();

  React.useEffect(() => {
    getProductData();
  }, []);

  const getProductData = () => {
    axios.get(`http://localhost:8080/items/viewproducts`)
      .then(function (response) {
        setProducts(response.data);
      })
      .catch(function (error) {
        console.log(`error ${error}`);
      })
  }
    return (
        <>
            <div id="templatemo_wrapper_h">
                <div id="templatemo_header_wh">
                    <div id="templatemo_header" class="header_home">
                        <div id="site_title"><Link to="#">Floral Shop</Link></div>
                        <Header/>

                        <div class="slider-wrapper theme-orman">
                            <div class="ribbon"></div>
                            <div id="slider" class="nivoSlider">
                                <img src={`./assets/images/portfolio/01.jpg`} alt="slider img 1" />
                                <Link to="#">
                                    <img src={`./assets/images/portfolio/02.jpg`} alt="slider img 2" title="This is an example of Link caption" />
                                </Link>
                                <img src={`./assets/images/portfolio/03.jpg`} alt="slider img 3" />
                                <img src={`./assets/images/portfolio/04.jpg`} alt="slider img 4" title="#htmlcaption" />
                                <img src={`./assets/images/portfolio/05.jpg`} alt="slider img 5" title="#htmlcaption" />
                            </div>
                            <div id="htmlcaption" class="nivo-html-caption">
                                <strong>Example</strong> caption with <Link to="http://dev7studios.com" rel="nofollow">Link credit link</Link> for <em>this slider</em>.
                            </div>
                        </div>

                    </div>
                </div>
                <div id="templatemo_main_wrapper">
                    <div id="templatemo_main">
                       <Sidebar/>

                        <div id="content" class="right">
                            <h2>Welcome to Floral Shop</h2>
                            <p>Floral Shop is free website template by templatemo. Sed in suscipit risus, eget consectetur justo. Praesent lacinia, nisi quis commodo consectetur, diam magna laoreet felis, Link pulvinar mauris enim in felis. Phasellus in mauris velit. In pellentesque massa in nisl auctor pellentesque. Donec fermentum convallis purus, id luctus nulla tempus in. Aliquam diam nibh, consectetur quis fringilla facilisis, egestas sed odio. Validate <Link to="http://validator.w3.org/check?uri=referer" rel="nofollow"><strong>XHTML</strong></Link> &amp; <Link to="http://jigsaw.w3.org/css-validator/check/referer" rel="nofollow"><strong>CSS</strong></Link>.</p>

                            {products && products.map((data, key) => {
                            return (
                                <>
                            <div class="product_box">
                                <Link to="productdetail.html"><img src={`./assets/images/product/01.jpg`} alt="floral set 1" /></Link>
                                <h3>Ut eu feugiat</h3>
                                <p class="product_price">$240</p>
                                <p class="add_to_cart">
                                    <Link to="productdetail.html">Detail</Link>
                                    <Link to="shoppingcart.html">Add to Cart</Link>
                                </p>
                            </div>
                            </>
                            )
                        })}

                           

                            <div class="blank_box">
                                <Link to="#"><img src={`./assets/images/free_shipping.jpg`} alt="Free Shipping" /></Link>
                            </div>
                        </div>
                        <div class="cleaner"></div>
                    </div>
                </div>

                <Footer />
            </div>
        </>
    )
}

export default Home
